INSERT INTO `wx_article` VALUES ('0ae7dfb73ee347549fcee5f22e74ad78', '4db5PKk3WXqxnReJJV9A9w', null, '七个架构实践案例：高可用系统、消息队列、中间件、直播系统、微服务……', null, '<html>\n <head>\n  <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"> \n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\"> \n  <meta name=\"viewport\" content=\"width=device-width,initial-scale=1.0,maximum-scale=1.0,user-scalable=0\"> \n  <meta name=\"apple-mobile-web-app-capable\" content=\"yes\"> \n  <meta name=\"apple-mobile-web-app-status-bar-style\" content=\"black\"> \n  <meta name=\"format-detection\" content=\"telephone=no\"> \n  <link rel=\"dns-prefetch\" href=\"//res.wx.qq.com\"> \n  <link rel=\"dns-prefetch\" href=\"//mmbiz.qpic.cn\"> \n  <link rel=\"shortcut icon\" type=\"image/x-icon\" href=\"//res.wx.qq.com/mmbizwap/zh_CN/htmledition/images/icon/common/favicon22c41b.ico\"> \n  <title>七个架构实践案例：高可用系统、消息队列、中间件、直播系统、微服务……</title> \n  <style>html{-ms-text-size-adjust:100%;-webkit-text-size-adjust:100%;line-height:1.6}body{-webkit-touch-callout:none;font-family:-apple-system-font,\"Helvetica Neue\",\"PingFang SC\",\"Hiragino Sans GB\",\"Microsoft YaHei\",sans-serif;background-color:#f3f3f3;line-height:inherit}body.rich_media_empty_extra{background-color:#fff}body.rich_media_empty_extra .rich_media_area_primary:before{display:none}h1,h2,h3,h4,h5,h6{font-weight:400;font-size:16px}*{margin:0;padding:0}a{color:#607fa6;text-decoration:none}.rich_media_inner{font-size:16px;word-wrap:break-word;-webkit-hyphens:auto;-ms-hyphens:auto;hyphens:auto}.rich_media_area_primary{position:relative;padding:20px 15px 15px;background-color:#fff}.rich_media_area_primary:before{content:\" \";position:absolute;left:0;top:0;width:100%;height:1px;border-top:1px solid #e5e5e5;-webkit-transform-origin:0 0;transform-origin:0 0;-webkit-transform:scaleY(0.5);transform:scaleY(0.5);top:auto;bottom:-2px}.rich_media_area_primary .original_img_wrp{display:inline-block;font-size:0}.rich_media_area_primary .original_img_wr