ight-radius:1.2em 50%;border-bottom-left-radius:1.2em 50%;-moz-border-radius-bottomleft:1.2em 50%;-webkit-border-bottom-left-radius:1.2em 50%;border-bottom-right-radius:1.2em 50%;-moz-border-radius-bottomright:1.2em 50%;-webkit-border-bottom-right-radius:1.2em 50%;line-height:2.3;font-size:11px;color:#fff;text-align:center;position:absolute;bottom:10px;left:10px;min-width:65px}.gif_img_tips.loading{min-width:75px}.gif_img_tips i{vertical-align:middle;margin:-0.2em .73em 0 -2px}.gif_img_play_arrow{display:inline-block;width:0;height:0;border-width:8px;border-style:dashed;border-color:transparent;border-right-width:0;border-left-color:#fff;border-left-style:solid;border-width:5px 0 5px 8px}.gif_img_loading{width:14px;height:14px}i.gif_img_loading{margin-left:-4px}.gif_bg_tips_wrp{position:relative;height:0;line-height:0;margin:0;padding:0}.gif_bg_tips_wrp .gif_img_tips_group{position:absolute;top:0;left:0;z-index:9999}.gif_bg_tips_wrp .gif_img_tips_group .gif_img_tips{top:0;left:0;bottom:auto}.rich_media_global_msg{position:fixed;top:0;left:0;right:0;padding:1em 35px 1em 15px;z-index:1;background-color:#c6e0f8;color:#8c8c8c;font-size:13px}.rich_media_global_msg .icon_closed{position:absolute;right:15px;top:50%;margin-top:-5px;line-height:300px;overflow:hidden;-webkit-tap-highlight-color:rgba(0,0,0,0);background:transparent url(/mmbizwap/zh_CN/htmledition/images/icon/appmsg/icon_appmsg_msg_closed_sprite.2x.png) no-repeat 0 0;width:11px;height:11px;vertical-align:middle;display:inline-block;-webkit-background-size:100% auto;background-size:100% auto}.rich_media_global_msg .icon_closed:active{background-position:0 -17px}.preview_appmsg .rich_media_title{margin-top:1.9em}@media screen and (min-width:1024px){.rich_media_global_msg{position:relative;margin:0 20px}.preview_appmsg .rich_media_title{margin-top:0}}</style> \n  <style>\r\n     \r\n    </style> \n  <!--[if lt IE 9]>\r\n<link onerror=\"wx_loaderror(this)\" rel=\"stylesheet\" type=\"text/css\" href=\"//res.wx.qq.com/mmbizwap/zh_CN/htmledition/style/page/appmsg/page_mp_article_improve_pc2c9cd6.css\">\r\n<![endif]-->\n </head>\n <body>\n  <div id=\"js_top_ad_area\" class=\"top_banner\"> \n  </div> \n  <div class=\"rich_media_inner\"> \n   <div id=\"page-content\"> \n    <div id=\"img-content\" class=\"rich_media_area_primary\"> \n     <h2 class=\"rich_media_title\" id=\"activity-name\"> 七个架构实践案例：高可用系统、消息队列、中间件、直播系统、微服务…… </h2> \n     <div class=\"rich_media_meta_list\"> \n      <em id=\"post-date\" class=\"rich_media_meta rich_media_meta_text\">2017-03-10</em> \n      <em class=\"rich_media_meta rich_media_meta_text\">EDU学院</em> \n      <a class=\"rich_media_meta rich_media_meta_link rich_media_meta_nickname\" href=\"##\" id=\"post-user\">架构文摘</a> \n      <span class=\"rich_media_meta rich_media_meta_text rich_media_meta_nickname\">架构文摘</span> \n      <div id=\"js_profile_qrcode\" class=\"profile_container\" style=\"display:none;\"> \n       <div class=\"profile_inner\"> \n        <strong class=\"profile_nickname\">架构文摘</strong> \n        <img class=\"profile_avatar\" id=\"js_profile_qrcode_img\" src=\"\" alt=\"\"> \n        <p class=\"profile_meta\"> <label class=\"profile_meta_label\">微信号</label> <span class=\"profile_meta_value\">ArchDigest</span> </p> \n        <p class=\"profile_meta\"> <label class=\"profile_meta_label\">功能介绍</label> <span class=\"profile_meta_value\">每天一篇架构领域重磅好文，涉及一线互联网公司的互联网应用架构、大数据、机器学习等各个热门领域。</span> </p> \n       </div> \n       <span class=\"profile_arrow_wrp\" id=\"js_profile_arrow_wrp\"> <i class=\"profile_arrow arrow_out\"></i> <i class=\"profile_arrow arrow_in\"></i> </span> \n      </div> \n     </div> \n     <div class=\"rich_media_content \" id=\"js_content\"> \n      <p><span style=\"font-size: 14px;\">2017年3月25日，<strong>SDCC 2017之</strong><strong><a target=\"_blank\">线上互联网应用架构实战峰会</a></strong>讲在CSDN学院召开，带来为期一天共计7个研发案例的分享；本次峰会集结了百度外卖、58集团、新浪微博、美团点评、当当网、链家网和沃趣科技的架构案例，议题涵盖高可用系统、消息队列、中间件、直播系统、电商、数据库、微服务、安全等。同时，邀请了58集团技术委员会主席孙玄担任此次峰会的出品人和把关人，严格把握演讲方向和审核课件内容，以期带来一场精彩的技术盛宴，为开发者提供一个有深度的交流平台。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <blockquote> \n       <p><span style=\"font-size: 14px;\"><strong>峰会官网：</strong></span><span style=\"font-size: 14px;\">http://edu.csdn.net/huiyiCourse/series_detail/29?ref=5<strong>（或点击文末的阅读原文）</strong></span></p> \n      </blockquote> \n      <h2><span style=\"font-size: 14px;\"><strong><br></strong></span></h2> \n      <h2><span style=\"font-size: 14px; color: rgb(64, 118, 0);\"><strong>日前，主办方公布了本次峰会的全部嘉宾阵容和议题，详情如下：</strong></span></h2> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <h3><span style=\"font-size: 14px;\"><strong>李思诚：美团团购订单系统优化实践</strong></span></h3> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvSnvwCpO7pnNYQe8MLZRc8Ma8FIr2dBAhGt8I6AiaX7HGkLibDxrLYuHg/0?wx_fmt=jpeg\" title=\"\" data-type=\"jpeg\" data-ratio=\"0.6657894736842105\" data-w=\"380\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvSnvwCpO7pnNYQe8MLZRc8Ma8FIr2dBAhGt8I6AiaX7HGkLibDxrLYuHg/0?wx_fmt=jpeg\"></p> \n      <p><br></p> \n      <p><span style=\"font-size: 14px;\"><strong>嘉宾介绍：</strong> 2010年毕业于清华大学计算机科学与技术系，先后就职于完美世界、百度。2015年加入原美团，负责团购订单系统，带领团队对团购订单系统进行了服务化，提升了系统稳定性，承受住了七夕等高峰流量。2017年开始负责美团点评酒店订单系统。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>主题大纲：</strong>本次分享订单系统设计、优化的常见方式方法。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>听众受益：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">确定分库分表数据库中间层和NoSQL、NewSQL的选择和使用场景；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">分库分表中间层的特点以及选型；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">自研一个数据库中间层的关注点；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">了解柔性事务对分布式数据库的辅助；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">如果选择使用开源的sharding-JDBC会给您带来什么帮助。</span></p></li> \n      </ol> \n      <hr> \n      <h3><span style=\"font-size: 14px;\"><strong><br></strong></span></h3> \n      <h3><span style=\"font-size: 14px;\"><strong>武晖：微博直播互动系统架构实战</strong></span></h3> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvawQicgCrnAyiajAMxOpG7pwdQ2SI9IKFB05eX0ibNic4CUia4bdTA9RoNtg/0?wx_fmt=jpeg\" title=\"\" data-type=\"jpeg\" data-ratio=\"0.6657894736842105\" data-w=\"380\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvawQicgCrnAyiajAMxOpG7pwdQ2SI9IKFB05eX0ibNic4CUia4bdTA9RoNtg/0?wx_fmt=jpeg\"></p> \n      <p><br></p> \n      <p><span style=\"font-size: 14px;\"><strong>嘉宾介绍：</strong>电子科技大学硕士，微博研发中心平台系统研发工程师，从事微博通讯相关系统的研发，当前负责微博直播消息互动系统的研发，支撑每秒百万级的消息互动分发，并实现系统的自动扩缩容能力。技术上擅长消息通讯方向，对系统高可用、高并发方面有丰富的实践经验。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>主题大纲：</strong>主要介绍微博直播中的消息互动系统的架构设计，以支持百万级的消息互动分发。在上线后面对业务上的极端峰值是如何利用云实现5分钟快速扩容，并分享在使用云服务中的一些经验。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>听众受益：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">了解如何考虑和设计一个支持高可用的百万在线的直播互动系统架构；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">了解如何利用云应对业务极端峰值；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">了解使用云服务中可能遇到的问题。</span></p></li> \n      </ol> \n      <hr> \n      <h3><span style=\"font-size: 14px;\"><br></span></h3> \n      <h3><span style=\"font-size: 14px;\"><strong><a target=\"_blank\">张亮</a>：轻量级当当数据库中间件 Sharding-JDBC 深度解析</strong></span></h3> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvbJwv1gBia6pfhBicX8NjCiae7XOjbtn4gbbJR5ORVWDmiaWg9iagp8rl6fQ/0?wx_fmt=jpeg\" title=\"\" data-type=\"jpeg\" data-ratio=\"0.6657894736842105\" data-w=\"380\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvbJwv1gBia6pfhBicX8NjCiae7XOjbtn4gbbJR5ORVWDmiaWg9iagp8rl6fQ/0?wx_fmt=jpeg\"></p> \n      <p><br></p> \n      <p><span style=\"font-size: 14px;\"><strong>嘉宾介绍：</strong>当当架构部总监，主要负责当当中间件以及云平台的研发和搭建。致力于开源，将在当当应用成熟的分布式调度系统Elastic-Job和数据库分库分表中间层Sharding-JDBC开源。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>主题大纲：</strong>此次分享将探讨分布式数据库中间层的适用场景和自研的选型过程，并深度解析当当的开源产品sharding-JDBC的整体架构、设计思路以及关键技术点。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>听众受益：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">确定分库分表数据库中间层和NoSQL、NewSQL的选择和使用场景；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">分库分表中间层的特点以及选型；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">自研一个数据库中间层的关注点；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">了解柔性事务对分布式数据库的辅助；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">如果选择使用开源的sharding-JDBC会给您带来什么帮助。</span></p></li> \n      </ol> \n      <hr> \n      <h3><span style=\"font-size: 14px;\"><strong><br></strong></span></h3> \n      <h3><span style=\"font-size: 14px;\"><strong>柏湘桂：基于指纹识别的 Nginx+Lua 攻击防范系统</strong></span></h3> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvpzEYpn1IFZAztCgtKUCzEdhHL09TYjIkEAz46xZ4XrNia4IYmRiaOXOw/0?wx_fmt=jpeg\" title=\"\" data-type=\"jpeg\" data-ratio=\"0.6657894736842105\" data-w=\"380\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvpzEYpn1IFZAztCgtKUCzEdhHL09TYjIkEAz46xZ4XrNia4IYmRiaOXOw/0?wx_fmt=jpeg\"></p> \n      <p><br></p> \n      <p><span style=\"font-size: 14px;\"><strong>嘉宾介绍：</strong>百度外卖商业平台部架构师，曾就职用友软件、百度、乌云、2016年入职百度外卖，现在负责商业平台部技术架构、对安全、数据库存储研究感兴趣。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>主题大纲：</strong>在本次分享中我们着重从给流量建立指纹，并结合浏览器特性来辅助识别（攻击工具发出的流量一般不具备浏览器特性）, 结合对Nginx的嵌入式开发（Lua），灵活的处理攻击流量，对流量重定向到其他流量黑屋子集群，或其他策略控制系统。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>听众受益：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p><span style=\"font-size: 14px;\">嵌入式开发，安全防范知识、精准攻击流量识别。</span></p> \n      <hr> \n      <h3><span style=\"font-size: 14px;\"><strong><br></strong></span></h3> \n      <h3><span style=\"font-size: 14px;\"><strong>刘阳龙：链家网堡垒机实现以及用户访问权限设计</strong></span></h3> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvb1ia7wLxGSFkYn16icQynUwHvABCMmAMqpRZIGO5mFHXXc77EiaBgKemA/0?wx_fmt=jpeg\" title=\"\" data-type=\"jpeg\" data-ratio=\"0.6657894736842105\" data-w=\"380\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvb1ia7wLxGSFkYn16icQynUwHvABCMmAMqpRZIGO5mFHXXc77EiaBgKemA/0?wx_fmt=jpeg\"></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>嘉宾介绍：</strong>链家网系统运维部运维研发工程师，曾就职于新浪微博和百度BAE，python/Go爱好者，对优秀的技术架构有着狂热的爱好，目前就职于链家网任SRE工程师，负责链家网基础服务、运维平台架构等相关方面的研发。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>主题大纲：</strong>当前面两个情况是你当前的处境时，你最好能够在事故（领导发威）前有效的解决潜在的隐患。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\">当你又囊中羞涩时，那么，就来看我此次分享吧，哥会告诉你如何廉价有效并且方便快速的为你的网络资产安装一道防火大门。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>听众受益</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">服务器程序部署权限设计；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">sudoer相关权限介绍；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">通用堡垒机设计方案。</span></p></li> \n      </ol> \n      <hr> \n      <h3><span style=\"font-size: 14px;\"><strong><br></strong></span></h3> \n      <h3><span style=\"font-size: 14px;\"><strong>麻鹏飞：MySQL/MariaDB 并发复制架构演变</strong></span></h3> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvBkC1j7MrnnzHLnQQ0U5RHzaib2jnySa9iaUKnsHlPlHUAUdxvN9N9piaQ/0?wx_fmt=jpeg\" title=\"\" data-type=\"jpeg\" data-ratio=\"0.6657894736842105\" data-w=\"380\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvBkC1j7MrnnzHLnQQ0U5RHzaib2jnySa9iaUKnsHlPlHUAUdxvN9N9piaQ/0?wx_fmt=jpeg\"></p> \n      <p><br></p> \n      <p><span style=\"font-size: 14px;\"><strong>嘉宾介绍：</strong>杭州沃趣科技MySQL高级工程师，Oracle MySQL OCP，精通MySQL／MariaDB 内部架构原理，精通MySQL/MariaDB 主流Cluster架构。有多年金融、证劵及互联网行业的数据库运维管理经验。曾在CSDN技术论坛发表过多篇MySQL／MariaDB 技术文章被置顶阅读量过十万。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>主题大纲：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">MySQL/MariaDB 主备复制架构原理；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">Binlog 二阶段和组提提交原理；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">MySQL/MariaDB Enhanced Multi-threaded Slaves。</span></p></li> \n      </ol> \n      <p><br></p> \n      <p><span style=\"font-size: 14px;\"><strong>听众受益：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">深入了解MySQL/MariaDB 基于Binlog 主备复制架构演变过程和解决的场景；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">构建高可用、数据零丢失和数据一致性的架构提供理论和实践依据。</span></p></li> \n      </ol> \n      <hr> \n      <h3><span style=\"font-size: 14px;\"><br></span></h3> \n      <h3><span style=\"font-size: 14px;\"><strong><a target=\"_blank\">孙玄：</a>微服务架构如何实践落地</strong></span></h3> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvIuFHxCbbbAaTibooHMYHcmTMHTB2gJtqg1mJXddkpfMoEePr0mWlicoQ/0?wx_fmt=jpeg\" title=\"\" data-type=\"jpeg\" data-ratio=\"0.6657894736842105\" data-w=\"380\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_jpg/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvIuFHxCbbbAaTibooHMYHcmTMHTB2gJtqg1mJXddkpfMoEePr0mWlicoQ/0?wx_fmt=jpeg\"></p> \n      <p><br></p> \n      <p><span style=\"font-size: 14px;\"><strong>嘉宾介绍：</strong> 58同城高级系统架构师，58集团技术委员会主席&amp;架构组主任，产品技术学院优秀讲师，58同城即时通讯、转转技术负责人，擅长系统架构设计、分布式存储等技术领域。代表58同城多次参与QCon、SDCC、DTCC、Top100、Hadoop World等大会嘉宾演讲，并为《程序员》杂志撰稿2篇。 前百度高级工程师，参与社区搜索部多个基础系统的设计与实现。毕业于浙江大学。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>主题大纲：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">什么是微服务架构；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">微服务架构特点及其应用场景；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">一个典型的微服务架构；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">微服务架构常用设计模式及案例实战；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">微服务架构如何实践数据一致性。</span></p></li> \n      </ol> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong>听众受益：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">了解微服务架构模式使用的场合；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">了解微服务架构理念在具体项目中的如何落地实践。</span></p></li> \n      </ol> \n      <h2><span style=\"font-size: 14px;\"><strong><br></strong></span></h2> \n      <h2><span style=\"font-size: 14px;\"><strong>SDCC 2017之线上互联网应用架构实战峰会日程</strong></span></h2> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p><span style=\"font-size: 14px;\"></span></p> \n      <p style=\"text-align: center;\"><img data-s=\"300,640\" data-type=\"png\" data-src=\"http://mmbiz.qpic.cn/mmbiz_png/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvV5nicqUwNQ11vNQsuEgeTATAmJy6gMtaZ9BAEsVegBtftLh6BJqJsxA/0?wx_fmt=png\" data-ratio=\"0.7170385395537525\" data-w=\"986\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_png/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvV5nicqUwNQ11vNQsuEgeTATAmJy6gMtaZ9BAEsVegBtftLh6BJqJsxA/0?wx_fmt=png\"></p> \n      <p style=\"text-align: right;\"><span style=\"font-size: 12px; color: rgb(136, 136, 136);\">（可点击图片查看高清大图）</span></p> \n      <p><br></p> \n      <p><span style=\"font-size: 14px; color: rgb(136, 136, 136);\"><strong>峰会报名咨询</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <p><span style=\"font-size: 14px;\">对于课程有一切疑问，均可微信扫描下方二维码进入「CSDN 架构实战峰会咨询群」进行技术交流，或直接加微信小助手「csdncxrs」备注关键词：「架构实战」提问。</span></p> \n      <p><span style=\"font-size: 14px;\"><br></span></p> \n      <p style=\"text-align: center;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_png/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvGk6WiaiczsicnkGJCZVrR6FxGnXRzwAdOUapH3SGAaA00ydLicVsLfjraA/0?wx_fmt=png\" title=\"\" data-type=\"png\" data-ratio=\"0.9664429530201343\" data-w=\"149\" src=\"http://ffsip.ffzxnet.com/ffsip-admin/OpenApi/resource.do?url=http://mmbiz.qpic.cn/mmbiz_png/icNyEYk3VqGkmaJOsFxTm5E6CglfZZYHvGk6WiaiczsicnkGJCZVrR6FxGnXRzwAdOUapH3SGAaA00ydLicVsLfjraA/0?wx_fmt=png\"></p> \n      <p><br></p> \n      <center> \n       <span style=\"font-size: 14px;\">扫描上方二维码添加峰会微信小助手进行咨询</span> \n      </center> \n      <p><br></p> \n      <p><span style=\"font-size: 14px; color: rgb(136, 136, 136);\"><strong>峰会报名提醒：</strong></span></p> \n      <p><span style=\"font-size: 14px;\"><strong><br></strong></span></p> \n      <ol class=\" list-paddingleft-2\"> \n       <li><p><span style=\"font-size: 14px;\">为了方便开课前收到开课提醒，请在报名的时候务必填写真实的手机号码和邮箱；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">在开课后一周内会上传本节课的视频回放，届时请到报名页查看回顾即可（无限时回放）；</span></p></li> \n       <li><p><span style=\"font-size: 14px;\">请报名的时候注意自己的报名账号，不要搞混了哦~，如果疑问请联系学院客服或者其他的负责直播的人员。</span></p></li> \n      </ol> \n      <p><br></p> \n      <p><br></p> \n      <blockquote> \n       <p><span style=\"font-size: 16px; color: rgb(64, 118, 0);\"><strong>峰会报名请点击左下角的「阅读原文<strong style=\"color: rgb(64, 118, 0); font-size: 16px; white-space: normal;\">」</strong>。</strong></span><span style=\"font-size: 14px; text-decoration: underline;\"></span></p> \n      </blockquote> \n     </div> \n     <div class=\"ct_mpda_wrp\" id=\"js_sponsor_ad_area\" style=\"display:none;\"> \n     </div> \n     <div class=\"rich_media_tool\" id=\"js_toobar3\"> \n      <a class=\"media_tool_meta meta_primary\" id=\"js_view_source\" href=\"##\">阅读原文</a> \n      <div id=\"js_read_area3\" class=\"media_tool_meta tips_global meta_primary\" style=\"display:none;\">\n        阅读 \n       <span id=\"readNum3\"></span> \n      </div> \n      <span style=\"display:none;\" class=\"media_tool_meta meta_primary tips_global meta_praise\" id=\"like3\"> <i class=\"icon_praise_gray\"></i><span class=\"praise_num\" id=\"likeNum3\"></span> </span> \n      <a id=\"js_report_article3\" style=\"display:none;\" class=\"media_tool_meta tips_global meta_extra\" href=\"##\">投诉</a> \n     </div> \n    </div> \n    <div class=\"rich_media_area_primary sougou\" id=\"sg_tj\" style=\"display:none\"> \n    </div> \n    <div class=\"rich_media_area_extra\"> \n     <div class=\"mpda_bottom_container\" id=\"js_bottom_ad_area\"> \n     </div> \n     <div id=\"js_iframetest\" style=\"display:none;\"></div> \n     <div class=\"rich_media_extra\" id=\"js_cmt_area\" style=\"display:none\"> \n      <div class=\"discuss_container\" id=\"js_cmt_main\" style=\"display:none\"> \n       <div class=\"rich_tips with_line title_tips discuss_title_line\"> \n        <span class=\"tips\">精选留言</span> \n       </div> \n       <p class=\"tips_global tc title_bottom_tips\" id=\"js_cmt_nofans1\" style=\"display:none;\">该文章作者已设置需关注才可以留言</p> \n       <p class=\"discuss_icon_tips title_bottom_tips tr\" id=\"js_cmt_addbtn1\" style=\"display:none\"> <a href=\"\" id=\"js_cmt_write1\">写留言<img class=\"icon_edit\" src=\"//res.wx.qq.com/mmbizwap/zh_CN/htmledition/images/icon/appmsg/icon_edit25ded2.png\" alt=\"\"></a> </p> \n       <ul class=\"discuss_list\" id=\"js_cmt_list\"></ul> \n      </div> \n      <div class=\"tips_global rich_split_tips tc\" id=\"js_cmt_nofans2\" style=\"display:none;\">\n        该文章作者已设置需关注才可以留言 \n      </div> \n      <p class=\"discuss_icon_tips rich_split_tips tr\" id=\"js_cmt_addbtn2\" style=\"display:none\"> <a href=\"\" id=\"js_cmt_write2\">写留言<img class=\"icon_edit\" src=\"//res.wx.qq.com/mmbizwap/zh_CN/htmledition/images/icon/appmsg/icon_edit25ded2.png\" alt=\"\"></a> </p> \n      <p class=\"rich_split_tips tc tips_global\" id=\"js_cmt_tips\" style=\"display:none;\"></p> \n      <div class=\"rich_tips tips_global loading_tips\" id=\"js_cmt_loading\"> \n       <img src=\"//res.wx.qq.com/mmbizwap/zh_CN/htmledition/images/icon/common/icon_loading_white2805ea.gif\" class=\"rich_icon icon_loading_white\" alt=\"\"> \n       <span class=\"tips\">加载中</span> \n      </div> \n      <div class=\"rich_tips with_line tips_global\" id=\"js_cmt_statement\" style=\"display:none\"> \n       <span class=\"tips\">以上留言由公众号筛选后显示</span> \n      </div> \n      <p class=\"rich_split_tips tc\" id=\"js_cmt_qa\" style=\"display:none;\"> <a href=\"http://kf.qq.com/touch/sappfaq/150211YfyMVj150313qmMbyi.html?scene_id=kf264\"> 了解留言功能详情 </a> </p> \n     </div> \n    </div> \n   </div> \n   <div id=\"js_pc_qr_code\" class=\"qr_code_pc_outer\" style=\"display:none;\"> \n    <div class=\"qr_code_pc_inner\"> \n     <div class=\"qr_code_pc\"> \n      <img id=\"js_pc_qr_code_img\" class=\"qr_code_pc_img\"> \n      <p>微信扫一扫<br>关注该公众号</p> \n     </div> \n    </div> \n   </div> \n  </div>\n </body>\n</html>', 'Y5GezCHeGYrmirjxnSgDrF', null, null, null, null, '', null, null, null, null, 'Y5GezCHeGYrmirjxnSgDrF', '2017-03-13 13:50:00', null, '2017-03-13 13:50:00');

-- ----------------------------
-- Table structure for wx_edit_article
-- ----------------------------
DROP TABLE IF EXISTS `wx_edit_article`;
CREATE TABLE `wx_edit_article` (
  `id` varchar(32) NOT NULL COMMENT 'id',
  `code` varchar(50) DEFAULT NULL COMMENT '编码',
  `name` varchar(20) DEFAULT NULL COMMENT '文件名',
  `title` varchar(200) DEFAULT NULL COMMENT '标题',
  `url` varchar(1000) DEFAULT NULL COMMENT '链接',
  `content` longtext COMMENT '内容',
  `source_content` longtext COMMENT '样式',
  `remarks` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_date` timestamp NULL DEFAULT NULL COMMENT '创建日期',
  `last_update_by` varchar(64) DEFAULT NULL COMMENT '最后修改人',
  `last_update_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of wx_edit_article
-- ----------------------------

-- ----------------------------
-- Table structure for wx_menu
-- ----------------------------
DROP TABLE IF EXISTS `wx_menu`;
CREATE TABLE `wx_menu` (
  `id` varchar(32) NOT NULL COMMENT 'id',
  `code` varchar(50) DEFAULT NULL COMMENT '编码',
  `name` varchar(20) DEFAULT NULL COMMENT '文件名',
  `type` varchar(20) DEFAULT NULL COMMENT '文件类型',
  `url` varchar(1000) DEFAULT NULL COMMENT '链接',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `p_code` varchar(50) DEFAULT NULL COMMENT '父级id',
  `remarks` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_date` timestamp NULL DEFAULT NULL COMMENT '创建日期',
  `last_update_by` varchar(64) DEFAULT NULL COMMENT '最后修改人',
  `last_update_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

